"use strict";(self.webpackChunkmy_2_rd_brain=self.webpackChunkmy_2_rd_brain||[]).push([[1477],{10:n=>{n.exports=JSON.parse('{"blogPosts":[{"id":"welcome","metadata":{"permalink":"/blog/welcome","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/1_index.md","source":"@site/blog/1_index.md","title":"Welcome","description":"Hi guys \ud83d\udc4b","date":"2024-05-27T14:53:32.000Z","formattedDate":"May 27, 2024","tags":[{"label":"introduction","permalink":"/blog/tags/introduction"},{"label":"hello","permalink":"/blog/tags/hello"}],"readingTime":0.475,"hasTruncateMarker":false,"authors":[{"name":"Phuong Duong","title":"Engineer","url":"https://github.com/dtphuong2612","imageURL":"img/IMG_5997.JPG","key":"dttph"}],"frontMatter":{"slug":"welcome","title":"Welcome","authors":["dttph"],"tags":["introduction","hello"],"sidebar_position":1},"nextItem":{"title":"The Song of Achilles_Madeline Miller","permalink":"/blog/The Song of Achilles_Madeline Miller"}},"content":"**Hi guys \ud83d\udc4b**\\n\\nI\'m Phuong Duong who is a final year student at National Economics University. My major is Data Science in Economics and Business. I always want to improve myself and learn anything new.\\n\\n    \ud83d\udd2d I\'m currently diving into Machine Learning\\n    \\n    \ud83d\ude04 I really like cute little things !!!!\\n    \\n    \ud83c\udf31 The best book to re-read is \\"Gi\u1ea5c M\u01a1 M\u1ef9 - \u0110\u01b0\u1eddng \u0110\u1ebfn Stanford\\" by Huyen Chip\\n    \\n    \u26a1 I usually watch youtube in my free time, my favorite channels are Giang Oi and Diep Minh\\n    \\n    \ud83d\udcac How to reach me:\\n    \\n            Email me at: dttph2612@gmail.com ^^"},{"id":"The Song of Achilles_Madeline Miller","metadata":{"permalink":"/blog/The Song of Achilles_Madeline Miller","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2_achilles.md","source":"@site/blog/2_achilles.md","title":"The Song of Achilles_Madeline Miller","description":"Hanoi, Friday 17th March ,2023","date":"2024-05-27T14:53:32.000Z","formattedDate":"May 27, 2024","tags":[{"label":"thesongofachilles","permalink":"/blog/tags/thesongofachilles"},{"label":"fiction","permalink":"/blog/tags/fiction"},{"label":"romance","permalink":"/blog/tags/romance"},{"label":"history","permalink":"/blog/tags/history"},{"label":"book","permalink":"/blog/tags/book"},{"label":"greek","permalink":"/blog/tags/greek"},{"label":"madelinemiller","permalink":"/blog/tags/madelinemiller"}],"readingTime":0.745,"hasTruncateMarker":false,"authors":[{"name":"Phuong Duong","title":"Engineer","url":"https://github.com/dtphuong2612","imageURL":"img/IMG_5997.JPG","key":"dttph"}],"frontMatter":{"slug":"The Song of Achilles_Madeline Miller","title":"The Song of Achilles_Madeline Miller","authors":["dttph"],"tags":["thesongofachilles","fiction","romance","history","book","greek","madelinemiller"],"sidebar_position":2},"prevItem":{"title":"Welcome","permalink":"/blog/welcome"},"nextItem":{"title":"M\u1eb9 l\xe0m g\xec c\xf3 \u01b0\u1edbc m\u01a1_H\u1ea1 Mer","permalink":"/blog/M\u1eb9 l\xe0m g\xec c\xf3 \u01b0\u1edbc m\u01a1_H\u1ea1 Mer"}},"content":"***Hanoi, Friday 17th March ,2023***\\n\\nThis is the first book I read in 2023, a friend recommended me ***The Song of Achilles***. At first I thought I might not be able to finish reading this book. There are two reasons for me to say that, the first is that it\'s too long and the second is that I\'ve always thought Greek mythology would be boring to read. But to my surprise, I read it all without skipping a single page.\\nThe story focuses on the love between two princes, Achilles and Patroclus, leaving me completely mesmerized by its beauty. They exhibited bravery and reciprocal kindness. Especially, their love is so strong that they never lie to one another.\\nTheir story moved me to tears, and I will add it to my list of books that I absolutely love. ***The Song of Achilles*** is a great piece of work.\\n\\n![\'Achilles\'](./img/achilles.jpg)"},{"id":"M\u1eb9 l\xe0m g\xec c\xf3 \u01b0\u1edbc m\u01a1_H\u1ea1 Mer","metadata":{"permalink":"/blog/M\u1eb9 l\xe0m g\xec c\xf3 \u01b0\u1edbc m\u01a1_H\u1ea1 Mer","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/3_melamgicouocmo.md","source":"@site/blog/3_melamgicouocmo.md","title":"M\u1eb9 l\xe0m g\xec c\xf3 \u01b0\u1edbc m\u01a1_H\u1ea1 Mer","description":"Hanoi,19th April ,2023","date":"2024-05-27T14:53:32.000Z","formattedDate":"May 27, 2024","tags":[{"label":"mother","permalink":"/blog/tags/mother"},{"label":"book","permalink":"/blog/tags/book"}],"readingTime":0.81,"hasTruncateMarker":false,"authors":[{"name":"Phuong Duong","title":"Engineer","url":"https://github.com/dtphuong2612","imageURL":"img/IMG_5997.JPG","key":"dttph"}],"frontMatter":{"slug":"M\u1eb9 l\xe0m g\xec c\xf3 \u01b0\u1edbc m\u01a1_H\u1ea1 Mer","title":"M\u1eb9 l\xe0m g\xec c\xf3 \u01b0\u1edbc m\u01a1_H\u1ea1 Mer","authors":["dttph"],"tags":["mother","book"],"sidebar_position":3},"prevItem":{"title":"The Song of Achilles_Madeline Miller","permalink":"/blog/The Song of Achilles_Madeline Miller"},"nextItem":{"title":"4_miendich","permalink":"/blog/4_miendich"}},"content":"***Hanoi,19th April ,2023***\\n\ud83d\udc67\ud83c\udffc:\\"H\u1ed3i tr\u01b0\u1edbc, m\u1eb9 \u01b0\u1edbc m\u01a1 l\xe0 g\xec th\u1ebf m\u1eb9\\"\\n\\n\ud83d\udc69\ud83c\udffb:\\"Tr\u01b0\u1edbc kia b\xe0 ngo\u1ea1i nhi\u1ec1u vi\u1ec7c l\u1eafm \u0111ang \u0103n c\u01a1m ch\u01b0a xong c\xf2n ph\u1ea3i ch\u1ea1y \u0111i h\u1ecdc lu\xf4n, l\xe0m g\xec c\xf3 th\u1eddi gian m\xe0 ngh\u0129 xem m\xecnh mu\u1ed1n g\xec\\"\\n\\n\ud83d\udc69\ud83c\udffb:\\"\u0110\u1ebfn l\xfac m\u1eb9 ngh\u1ec9 h\u1ecdc c\xf4 gi\xe1o v\u1eabn ti\u1ebfc v\xec m\u1eb9 c\u0169ng kh\xf4ng ph\u1ea3i ng\u01b0\u1eddi h\u1ecdc k\xe9m, tr\u01b0\u1edbc \u0111\xe2y m\u1eb9 ch\u1ec9 kh\xf4ng h\u1ecdc \u0111\u01b0\u1ee3c m\xf4n Ho\xe1 th\xf4i\\"\\n\\n\ud83d\udc67\ud83c\udffc:\\"Th\u1ebf ch\u1eafc con gi\u1ed1ng m\u1eb9 r\u1ed3i, con c\u0169ng kh\xf4ng th\xedch h\u1ecdc Ho\xe1 \ud83d\ude05\\"\\n\\nBu\u1ed5i t\u1ed1i n\u1eb1m c\u1ea1nh m\u1eb9 vu v\u01a1 h\u1ecfi m\u1eb9 m\u1ed9t c\xe2u khi \u0111ang trong th\u1eddi gian \u0111\u1ecdc quy\u1ec3n s\xe1ch n\xe0y\ud83d\udcda\\n\\nM\u1ed9t quy\u1ec3n s\xe1ch nh\u01b0 t\xe1i hi\u1ec7n l\u1ea1i nh\u1eefng kho\u1ea3nh kh\u1eafc t\u01b0\u1edfng ch\u1eebng nh\u01b0 m\xecnh \u0111\xe3 qu\xean m\u1ea5t n\xf3 l\xe2u r\u1ed3i. Phong c\u1ea3nh l\xe0ng qu\xea, con ng\u01b0\u1eddi n\u01a1i \u0111\xf3, nh\u1eefng tr\xf2 ch\u01a1i c\u1ee7a nh\u1eefng \u0111\u1ee9a tr\u1ebb ch\u1eb3ng kh\xe1c ch\u1ed7 m\xecnh l\xe0 m\u1ea5y. Th\u1eadm ch\xed c\u1ea3 nh\u1eefng l\u1ea7n tr\xe1ch m\xf3c, nh\u1eefng l\u1ea7n ch\u1eb3ng ch\u1ecbu hi\u1ec3u cho b\u1ed1 m\u1eb9 c\u0169ng gi\u1ed1ng \u0111\u1ebfn l\u1ea1.\\n\\n![\'melamgicouocmo\'](./img/melamgicouocmo.jpeg)"},{"id":"/4_miendich","metadata":{"permalink":"/blog/4_miendich","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/4_miendich.md","source":"@site/blog/4_miendich.md","title":"4_miendich","description":"Mi\u1ec5n D\u1ecbch_Phillip Dettmer (D\u1ecbch b\u1edfi nh\xf3m Oddly Normal Podcast)","date":"2024-05-27T14:53:32.000Z","formattedDate":"May 27, 2024","tags":[],"readingTime":3.455,"hasTruncateMarker":false,"authors":[],"frontMatter":{},"prevItem":{"title":"M\u1eb9 l\xe0m g\xec c\xf3 \u01b0\u1edbc m\u01a1_H\u1ea1 Mer","permalink":"/blog/M\u1eb9 l\xe0m g\xec c\xf3 \u01b0\u1edbc m\u01a1_H\u1ea1 Mer"}},"content":"***Mi\u1ec5n D\u1ecbch_Phillip Dettmer (D\u1ecbch b\u1edfi nh\xf3m Oddly Normal Podcast)***\\n\\n**Ph\u1ea7n I: L\xe0m quen v\u1edbi h\u1ec7 mi\u1ec5n d\u1ecbch c\u1ee7a b\u1ea1n**\\n\\n*H\u1ec7 mi\u1ec5n d\u1ecbch l\xe0 g\xec?*\\n\\nH\u1ec7 mi\u1ec5n d\u1ecbch l\xe0 c\xf4ng c\u1ee5 \u0111\u1ec3 ph\xe2n bi\u1ec7t \\"*b\u1ea3n th\xe2n*\\" v\xe0 \\"*gi\xe1 tr\u1ecb ngo\u1ea1i lai*\\". Nh\u01b0ng \u0111\xf3 kh\xf4ng ph\u1ea3i l\xe0 m\u1ee5c ti\xeau c\u1ee7a n\xf3, m\xe0 \u0111\u1ec3 c\xe2n b\u1eb1ng gi\u1eefa c\xe1c y\u1ebfu t\u1ed1 v\xe0 t\u1ebf b\xe0o c\u01a1 th\u1ec3 m\u1edbi ch\xednh l\xe0 m\u1ee5c ti\xeau th\u1ef1c s\u1ef1 c\u1ee7a h\u1ec7 mi\u1ec5n d\u1ecbch. \\n\\nH\u1ec7 mi\u1ec5n d\u1ecbch lu\xf4n lu\xf4n chi\u1ebfn \u0111\u1ea5u kh\xf4ng ng\u1eebng \u0111\u1ec3 b\u1ea3o b\u1ec7 c\u01a1 th\u1ec3 c\u1ee7a ch\xfang ta kh\u1ecfi nh\u1eefng con virus hay vi khu\u1ea9n nguy hi\u1ec3m \u0111ang mong mu\u1ed1n x\xe2m nh\u1eadp c\u01a1 th\u1ec3 ta. Nh\xf3m sinh v\u1eadt n\xe0y lu\xf4n coi c\u01a1 th\u1ec3 ta gi\u1ed1ng nh\u01b0 l\xe0 m\u1ed9t ng\xf4i nh\xe0 h\u1ea1nh ph\xfac, n\u01a1i m\xe0 c\xf3 nh\u1eefng th\u1ee9c \u0103n r\u1ea5t ngon v\xe0 \u0111\u1eb7c bi\u1ec7t l\xe0 **Mi\u1ec5n Ph\xed**. Cho d\xf9 cu\u1ed1i c\xf9ng th\xec b\u1ea3n th\xe2n ch\xfang ta v\u1eabn l\xe0 l\xe0 k\u1ebb thua cu\u1ed9c nh\u01b0ng h\u1ec7 mi\u1ec5n d\u1ecbch v\u1eabn lu\xf4n c\u1ed1 g\u1eafng \u0111\u1ebfn nh\u1eefng gi\xe2y ph\xfat cu\u1ed1i c\xf9ng.\\n\\n\xc0 th\xec d\xf9 th\u1ebf nh\u01b0ng c\u0169ng c\xf3 nh\u1eefng l\xfac h\u1ec7 mi\u1ec5n d\u1ecbch c\u1ee7a ch\xfang ta ho\u1ea1t \u0111\u1ed9ng m\u1ed9t c\xe1ch th\xe1i qu\xe1 v\xe0 \u0111\xf4i l\xfac n\xf3 \u0111\xe3 nh\u1ea7m l\u1eabn v\xe0 hoang mang kh\xf4ng ph\xe2n bi\u1ec7t \u0111\u01b0\u1ee3c c\u01a1 th\u1ec3 v\xe0 y\u1ebfu t\u1ed1 ngo\u1ea1i lai. \u0110i\u1ec1u n\xe0y d\u1eabn \u0111\u1ebfn ta ph\u1ea3i u\u1ed1ng r\u1ea5t nhi\u1ec1u thu\u1ed1c (V\xed d\u1ee5 nh\u01b0 b\u1ec7nh d\u1ecb \u1ee9ng, h\u1ec7 mi\u1ec5n d\u1ecbch \u0111\xe3 ph\u1ea3n \u1ee9ng r\u1ea5t m\u1ea1nh m\u1ebd v\xe0 th\xe1i qu\xe1, n\xf3 \u0111\xe3 cho r\u1eb1ng c\u01a1 th\u1ec3 ch\xednh l\xe0 k\u1ebb th\xf9 v\xe0 n\xf3 quy\u1ebft \u0111\u1ecbnh b\u1ea3n th\xe2n ch\xednh l\xe0 nh\u1eefng ngo\u1ea1i lai v\xe0 n\xf3 c\u0169ng h\u1ebft s\u1ee9c chi\u1ebfn \u0111\u1ea5u)\\n\\n*B\u1ea3o v\u1ec7 c\xe1i g\xec c\u01a1?*\\n\\n\u0110i\u1ec3m y\u1ebfu c\u1ee7a c\u01a1 th\u1ec3 l\xe0 c\xe1c l\u1edbp ni\xeam m\u1ea1c d\u1ec5 b\u1ecb nhi\u1ec5m tr\xf9ng - nh\u01b0 b\u1ec1 m\u1eb7t kh\xed qu\u1ea3n, ph\u1ed5i, m\xed m\u1eaft, mi\u1ec7ng v\xe0 m\u0169i, d\u1ea1 d\xe0y v\xe0 ru\u1ed9t, c\u01a1 quan sinh d\u1ee5c v\xe0 b\xe0ng quang. (Ni\xeam m\u1ea1c l\xe0 nh\u1eefng ph\u1ea7n b\xean ngo\xe0i)\\n\\nC\u01a1 th\u1ec3 ch\xfang ta l\xe0 m\u1ed9t c\xe1i \u1ed1ng. \\n\\"Tr\xean \u0111\u01b0\u1eddng \u1ed1ng n\xe0y, c\xf3 quan sinh s\u1ea3n, l\u1ed7 m\u0169i v\xe0 l\u1ed7 tai ngo\xe0i l\xe0 nh\u1eefng l\u1ed7 ph\u1ee5 v\xe0 l\u1ed1i v\xe0o c\u1ee7a h\u1ec7 th\u1ed1ng \u0111\u01b0\u1eddng h\u1ea7m v\xe0 hang \u0111\u1ed9ng ch\u1eb1ng ch\u1ecbt ch\u1ea1y kh\u1eafp c\u01a1 th\u1ec3. H\u1ec7 th\u1ed1ng n\xe0y l\xe0 bi\xean gi\u1edbi c\u1ee7a c\u01a1 th\u1ec3, \u0111i\u1ec3m ti\u1ebfp x\xfac tr\u1ef1c ti\u1ebfp v\u1edbi th\u1ebf gi\u1eddi b\xean ngo\xe0i. C\u01a1 th\u1ec3 b\u1ea1n \u0111\u01a1n gi\u1ea3n l\xe0 bao b\u1ecdc xung quanh n\xf3. M\u1ed7i ng\xe0u c\xf3 h\xe0ng tri\u1ec7u k\u1ebb ngo\u1ea1i lai t\xecm c\xe1c x\xe2m nh\u1eadp v\xe0o c\u01a1 th\u1ec3 qua nh\u1eefng \'ph\u1ea7n b\xean ngo\xe0i\' n\u1eb1m b\xean trong n\xe0y. Qu\u1ea3 l\xe0 m\u1ed9t l\xe3nh th\u1ed5 m\xeanh m\xf4ng \u0111\u1ec3 b\u1ea3o v\u1ec7 n\u1ebfu b\u1ea1n ch\u1ec9 b\xe9 nh\u01b0 m\u1ed9t t\u1ebf b\xe0o. Di\u1ec5n t\xedch v\xf9ng Trung \xc2u hay mi\u1ec1n Trung c\u1ee7a n\u01b0\u1edbc M\u1ef9 r\xf4ng nh\u01b0 th\u1ebf n\xe0o \u0111\u1ed1i v\u1edbi b\u1ea1n th\xec v\u1edbi t\u1ebf b\xe0o di\u1ec7n t\xedch b\u1ec1 m\u1eb7t ni\xeam m\u1ea1c r\u1ed9ng y nh\u01b0 th\u1ebf. X\xe2y bao nhi\xeau V\u1ea1n L\xfd Tr\u01b0\u1eddng Th\xe0nh c\u0169ng kh\xf4ng \u0111\u1ee7, v\xec kh\xf4ng ch\u1ec9 m\u1ed7i khu v\u1ef1c c\u1ed5ng th\xe0nh c\u1ea7n \u0111\u01b0\u1ee3c b\u1ea3o v\u1ec7, m\xe0 l\xe0 *to\xe0n b\u1ed9 l\xe3nh th\u1ed5*. K\u1ebb ngo\u1ea1i lai kh\xf4ng ch\u1ec9 \u0111\u1ed9t nh\u1eadp t\u1eeb b\xean r\xeca. Ch\xfang c\xf2n c\xf3 th\u1ec3 nh\xe0y d\xf9 \u0111\u1ed5 b\u1ed9 v\xe0o b\xean trong. C\xf3 ngh\u0129a l\xe0 c\xe1c t\u1ebf b\xe0o c\u1ee7a b\u1ea1n ph\u1ea3i b\u1ea3o v\u1ec7 to\xe0n b\u1ed9 ch\xe2u l\u1ee5c. To\xe0n b\u1ed9\\"\\n\\nNh\u1eefng lo\u1ea1i s\xe2u b\u1ecd nguy hi\u1ec3m sinh s\u1ea3n t\u1ef1 do v\xf4 t\u1ed9i v\u1ea1 trong c\u01a1 th\u1ec3, \u0111\xf3 c\xf3 th\u1ec3 l\xe0 m\u1ed9t d\u1ea5u ch\u1ea5m h\u1ebft c\u1ee7a m\u1ed9t g\xe3 kh\u1ed5ng l\u1ed3. Nh\u01b0ng th\u1eadt may thay, nh\u01b0 ch\xfang ta \u0111\xe3 bi\u1ebft, m\xecnh c\xf3 m\u1ed9t \u0111\u1ed3ng minh tuy\u1ec7t v\u1eddi trong cu\u1ed9c chi\u1ebfn sinh t\u1ed3n n\xe0y: h\u1ec7 mi\u1ec5n d\u1ecbch. Ch\u1ec9 l\xe0 ch\xfang ta ch\u01b0a tr\xe2n tr\u1ecdng v\xe0 t\xf4n vinh n\xf3 nhi\u1ec1u nh\u01b0 n\xf3 x\u1ee9ng \u0111\xe1ng m\xe0 th\xf4i. \\n\\nH\u1ec7 mi\u1ec5n d\u1ecbch bi\u1ebfn c\u01a1 th\u1ec3 b\u1ea1n th\xe0nh m\u1ed9t ph\xe1o \u0111\xe0i. V\xe0 h\u01a1n th\u1ebf n\u1eefa, \u0111\xf3 l\xe0 m\u1ed9t ph\xe1o \u0111\xe0i ch\u1ee9a c\u1ea3 t\u1ef7 binh l\xednh hung h\xe3n, thi\u1ec7n chi\u1ebfn nh\u1ea5t v\u0169 tr\u1ee5. H\u1ecd c\xf3 v\xf4 s\u1ed1 v\u0169 kh\xed \u0111\u1ec3 t\xf9y \xfd s\u1eed d\u1ee5ng, v\xe0 h\u1ecd s\u1eed d\u1ee5ng ch\xfang m\u1ed9t c\xe1ch kh\xf4ng th\u01b0\u01a1ng ti\u1ebfc. \u0110\u1ed9i qu\xe2n mi\u1ec5n d\u1ecbch c\u1ee7a b\u1ea1n \u0111\xe3 ti\xeau di\u1ec7t h\xe0ng t\u1ef7 k\u1ebb th\xf9 v\xe0 k\xfd sinh tr\xf9ng b\u1ea1n t\u1eebng g\u1eb7p trong \u0111\u1eddi, v\xe0 v\u1eabn s\u1eb5n s\xe0ng gi\u1ebft th\xeam h\xe0ng t\u1ef7 ho\u1eb7c h\xe0ng ng\xe0n t\u1ef7 n\u1eefa. \\n\\n*T\u1ebf b\xe0o l\xe0 g\xec?*"}]}')}}]);